info.description:
#### TypeScript SDK Code Sample

```typescript
import { createClient } from 'liferay-headless-rest-client';
import { deleteAttachment } from 'liferay-headless-rest-client/headless-commerce-admin-catalog-v1.0';

const client = createClient({
    baseUrl: 'http://localhost:8080',
    headers: {
        Authorization: `Basic ${btoa("test@liferay.com:test")}`,
    },
});

async function main() {
    const { data } = await deleteAttachment({
        client,
        path: {
           id: "20125",
        },
    });

    console.log(data);
}
```
#### Java installation:

Liferay Commerce Admin Catalog API. A Java client JAR is available for use with the group ID 'com.liferay', artifact ID 'com.liferay.headless.commerce.admin.catalog.client', and version '4.0.73'.

```gradle
implementation group: "com.liferay", name: "com.liferay.headless.commerce.admin.catalog.client", version: "latest"
```

Reference: https://mvnrepository.com/artifact/com.liferay/com.liferay.headless.commerce.admin.catalog.client/latest

x-codeSamples.source:
import { createClient } from 'liferay-headless-rest-client';
import { deleteAttachment } from 'liferay-headless-rest-client/headless-commerce-admin-catalog-v1.0';

const client = createClient({
    baseUrl: 'http://localhost:8080',
    headers: {
        Authorization: `Basic ${btoa("test@liferay.com:test")}`,
    },
});

async function main() {
    const { data } = await deleteAttachment({
        client,
        path: {
           id: "20125",
        },
    });

    console.log(data);
}

const response = await Liferay.Util.fetch('/o/headless-commerce-admin-catalog/v1.0/attachment/{id}', {
  method: 'DELETE',
})

const data = await response.json();

console.log(data);

