    baseUrl: 'http://localhost:8080',
    headers: {
        Authorization: `Basic ${btoa("test@liferay.com:test")}`,
    },
});

async function main() {
    const { data } = await deleteSpecificationByExternalReferenceCode({
        client,
        path: {
           externalReferenceCode: "20125",
        },
    });

    console.log(data);
}

const response = await Liferay.Util.fetch('/o/headless-commerce-admin-catalog/v1.0/specifications/by-external-reference-code/{externalReferenceCode}', {
  method: 'DELETE',
})

const data = await response.json();

console.log(data);

